import './Hero.css';
import AboutButton from "./AboutButton"
function Hero(props) {
    return (
      <>
        <div className={'hero'}>
          
          <h1>Joshua Collier</h1>
          <h2>Bioinformatician & Full-Stack Developer</h2>
          <AboutButton></AboutButton>

        </div>
        
      </>
    );
  }
  
  export default Hero;
